import React from "react";
import { Header, Image, Table } from 'semantic-ui-react'
import styled from "styled-components";

//images
import lambdaLogo from "../Assets/School-images/lambdaLogo.png";







function Personal() {
  return (
    <Table basic='very' celled collapsing>
    <Table.Header>
      <Table.Row>
        <Table.HeaderCell>Professional</Table.HeaderCell>

      </Table.Row>
    </Table.Header>

    <Table.Body>

      <Table.Row>
        <Table.Cell>
          <Header as='h4' image>
            <Image src={lambdaLogo} rounded size='tiny' />
            <Header.Content>
              <a href = "https://dashboards.lambdaschool.com/students/seth-nadu/">Lambda DashBoard</a>
              <Header.Subheader>Check Your Grades</Header.Subheader>
            </Header.Content>
          </Header>
        </Table.Cell>
      </Table.Row>





    </Table.Body>
  </Table>
  );
}

export default Personal;
